css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("ulmf.org") {
  
  body, .page {
    background: #1B1B1D;
  }
  
  .alt2, .panel, .panelsurround, .pre-spoiler, .spoiler, .tborder, .vbmenu_control, .tfoot, .tcat, .thead, .vBulletin_editor {
    background: #222225;
  }
  
  .vbmenu_popup, .vbmenu_option, .vbmenu_option a:link, .vbmenu_option a:visited, .vbmenu_option_alink, .vbmenu_hilite_alink, .alt1, .alt1Active, #usercss_editor, fieldset  {
    background: #2A2A2E;
  }
  
  body, .page, .vbmenu_option, .vbmenu_option a:link, .vbmenu_option a:visited, .vbmenu_option_alink, .vbmenu_hilite_alink, .alt1, .alt1Active, .alt2, fieldset, fieldset td, legend, .panel, .panelsurround, .pre-spoiler, .spoiler {
    color: white;
  }
  
  a:link, a:visited, .vbmenu_option a:link, .vbmenu_option a:visited {
    color: #d1e8ff;
  }
  
  table, tbody, tr, td, .vbmenu_option, .vbmenu_option a:link, .vbmenu_option a:visited, .vbmenu_popup, .vbmenu_option_alink, .vbmenu_hilite_alink, fieldset, fieldset td, .panel, .panelsurround, .pre-spoiler, .spoiler, .tborder, .vbmenu_control, .tcat, .thead, .tfoot, .alt2, .vBulletin_editor {
    border: 0px none #1B1B1D !important;
  }
  
  body > table:nth-child(2) > tbody:nth-child(1) > tr:nth-child(1) > td:nth-child(1) > a:nth-child(1) > img:nth-child(1) {
    height: 0 !important;
    width: 0 !important;
    /* these numbers match the new image's dimensions */
    padding-left: 400px !important;
    padding-top: 85px !important;
    background: #1B1B1D url(data:image/png;base64,) no-repeat !important;
  }

}
